func sliceEqual(a []int, b []int) bool {
	if len(a) != len(b) {
		return false
	}
	for i := 0; i < len(a); i++ {
		if a[i] != b[i] {
			return false
		}
	}
	return true
}

func TestFindAna1(t *testing.T) {
	var r []int
	var q []int

	r = findAnagrams("cbaebabacd", "abc")
	q = []int{0, 6}
	if !sliceEqual(r, q) {
		t.Error(r, " shoudl equal ", q)
	}

	r = findAnagrams("cbaebabacd", "abd")
	q = []int{}
	if !sliceEqual(r, q) {
		t.Error(r, " shoudl equal ", q)
	}
	r = findAnagrams("abab", "ab")
	q = []int{0, 1, 2}
	if !sliceEqual(r, q) {
		t.Error(r, " shoudl equal ", q)
	}

	r = findAnagrams("a", "b")
	q = []int{}
	if !sliceEqual(r, q) {
		t.Error(r, " shoudl equal ", q)
	}

}

